pragma solidity ^0.8.7;

import "@chainlink/contracts/src/v0.8/interfaces/VRFCoordinatorV2Interface.sol";
import "@chainlink/contracts/src/v0.8/VRFConsumerBaseV2.sol";
import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";
import {VRFCoinFlip} from "./coinflip.sol";
import {VRFWorldCup} from "./worldCup.sol";

contract VRFResultFactory is VRFConsumerBaseV2, Ownable {
  VRFCoordinatorV2Interface COORDINATOR;
  uint64 s_subscriptionId;
  mapping(address => bool) consumers;
  mapping(uint256 => address) requestToConsumers;

  bytes32 keyHash =
      0x4b09e658ed251bcafeebbc69400383d49f344ace09b9576fe248bb02c003fe9f; // TODO: Should be parameter
  uint32 callbackGasLimit = 300000;
  uint16 requestConfirmations = 3;
  uint32 numWords = 2;

  event randomWordsRequested(address indexed consumer, uint256 indexed requestId);
  event vrfControllerCreated(address indexed owner, address indexed newCoinFlip);

  modifier onlyConsumer() {
    require(
      consumers[msg.sender],
      "Not consumer."
    );
    _;
  }

  constructor(address vrfCoordinator, uint64 subscriptionId, bytes32 _keyHash) VRFConsumerBaseV2(vrfCoordinator) {
    COORDINATOR = VRFCoordinatorV2Interface(vrfCoordinator);
    s_subscriptionId = subscriptionId;
    keyHash = _keyHash;
  }

  // Assumes the subscription is funded sufficiently.
  function requestRandomWords() external onlyConsumer returns(uint256) {
    // Will revert if subscription is not set and funded.
    uint256 s_requestId = COORDINATOR.requestRandomWords(
        keyHash,
        s_subscriptionId,
        requestConfirmations,
        callbackGasLimit,
        numWords
    );
    requestToConsumers[s_requestId] = msg.sender;
    emit randomWordsRequested(msg.sender, s_requestId);
    return s_requestId;
  }

  function fulfillRandomWords(
      uint256 requestId,
      uint256[] memory randomWords
  ) internal override {
      VRFCoinFlip(requestToConsumers[requestId]).setRandomWord(randomWords[0]);
  }

  // TODO make it generic random game
  function createCoinFlipController (address owner) public returns(address) {
    VRFCoinFlip c = new VRFCoinFlip(owner, address(this));
    address newCoinFlipAddr = address(c);
    consumers[newCoinFlipAddr] = true;
    emit vrfControllerCreated(msg.sender, newCoinFlipAddr);
    return newCoinFlipAddr;
  }

  function createWorldCupController (address owner) public returns(address) {
    VRFWorldCup c = new VRFWorldCup(owner, address(this));
    address newCoinController = address(c);
    consumers[newCoinController] = true;
    emit vrfControllerCreated(msg.sender, newCoinController);
    return newCoinController;
  }

}","keccak256":"0x6d936e6f482e2c79ddade3877a7254dd96a2e78273e399a0d113cf637de7cf1c","license":"MIT"},"contracts/vrf/worldCup.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import {baseResultController} from "../baseResultController.sol";
import {baseVRFController} from "./baseVrfController.sol";

contract VRFWorldCup is baseVRFController {

  constructor (address owner, address _wordsGenerator) baseVRFController(owner, _wordsGenerator) {
  }

  function _getGame () internal view override returns (bytes32)
  {
    return bytes32(abi.encodePacked("World Cup"));
  }

  function _addOptions () internal override {
    addOption(bytes32(abi.encodePacked("Argentina")));
    addOption(bytes32(abi.encodePacked("Australia")));
    addOption(bytes32(abi.encodePacked("Belgium")));
    addOption(bytes32(abi.encodePacked("Brazil")));
    addOption(bytes32(abi.encodePacked("Cameroon")));
    addOption(bytes32(abi.encodePacked("Canada")));
    addOption(bytes32(abi.encodePacked("Costa Rica")));
    addOption(bytes32(abi.encodePacked("Croatia")));
    addOption(bytes32(abi.encodePacked("Denmark")));
    addOption(bytes32(abi.encodePacked("Ecuador")));
    addOption(bytes32(abi.encodePacked("England")));
    addOption(bytes32(abi.encodePacked("France")));
    addOption(bytes32(abi.encodePacked("Germany")));
    addOption(bytes32(abi.encodePacked("Ghana")));
    addOption(bytes32(abi.encodePacked("Iran")));
    addOption(bytes32(abi.encodePacked("Japan")));
    addOption(bytes32(abi.encodePacked("Mexico")));
    addOption(bytes32(abi.encodePacked("Morocco")));
    addOption(bytes32(abi.encodePacked("Netherlands")));
    addOption(bytes32(abi.encodePacked("Poland")));
    addOption(bytes32(abi.encodePacked("Portugal")));
